    function sortBySupplyAsc(arr) {
      return arr
        .filter(d =>
          Number.isFinite(d.available_supply_percent) &&
          Number.isFinite(d.floor_price)
        )
        .slice()
        .sort((a, b) => a.available_supply_percent - b.available_supply_percent);
    }

    const sorted = sortBySupplyAsc(data);
    const labels = sorted.map(d => `${d.available_supply_percent}%, token: ${d.token_id}`); // supply %
    const floorPrices = sorted.map(d => d.floor_price);

    const ctx = document.getElementById('chart');
    new Chart(ctx, {
      type: 'line',
      data: {
        labels,
        datasets: [{
          label: 'Floor price',
          data: floorPrices,
          fill: false,
          tension: 0.25,
          pointRadius: 3,
        }]
      },
      options: {
        interaction: { mode: 'index', intersect: false },
        plugins: {
          tooltip: {
            callbacks: {
              title: items => `Available supply: ${items[0].label}`,
              label: item => `Floor: ${item.raw}`,
            }
          },
          legend: { display: true }
        },
        scales: {
          x: {
            title: { display: true, text: 'Available supply (%)' },
            ticks: { callback: v => `${labels[v]}%` }
          },
          y: {
            title: { display: true, text: 'Floor price' },
            beginAtZero: false
          }
        }
      }
    });
